import React, { Component } from 'react';

class Board extends Component {
  constructor(props) {
    super(props);

    this.state = {
      board: {}
    }
  }

  render() {
    var rows = [];
    for(var i = 0; i < 8; i++) {
      rows.push(<Row row={i} key={i}/>);
    }
    return rows;
  }

}

export default Board;
